  input: '"TEXT","F3A","C00364349","Please accept this amendment due to our discussion
    with Leah Palmer on April 16, 2003.  We have discovered that there were disbursements
    reported on May 2, 2001 on the Jerry Weller for Congress Committee, which should
    have been reported on Gerald C. Jerry Weller for Congress Committee.  We have
    contacted the Gerald C. Jerry Weller for Congress Committee to let them know they
    need to amend their report to show these disbursements.  So that the disbursements
    are covered under the Gerald C. Jerry Weller for Congress Committee we are reporting
    a transfer of funds to the committee from Jerry Weller for Congress per Leah Palmer.  Also
    please note that when we filed the Jerry Weller for Congress committee report,
    it was dated 1/1/01 to 6/30/01.  But the Jerry Weller for Congress Committee came
    into existence on 1/31/01.  Because of this please note that it has changed our
    cash on hand due to the entries that were from 1/1/01 to 1/30/01 that does not
    pertain to the Jerry Weller for Congress report.  The committee has taken the
    necessary steps so this will not happen in the future.  If you have any further
    questions please let us know."'
